import React from 'react';
import { Nav, NavDropdown } from 'react-bootstrap';

function PillsExample() {
  return (
    <Nav variant="pills" bg="white" defaultActiveKey="/home" style={{ backgroundColor: "orange" }}>
      <Nav.Item eventKey="/home" style={{ color: "white", fontSize: "150%", fontStyle: "italic" }}>
        <span role="img" aria-label="movie-icon" style={{ marginRight: "5px" }}> ðŸŽ¬  Movies  </span> 
      </Nav.Item>

      <Nav.Item>
        <Nav.Link eventKey="link-1" style={{ color: "white" }}>
          Option 2
        </Nav.Link>
      </Nav.Item>

      <Nav.Item>
        <Nav.Link eventKey="link-2" style={{ color: "white" }}>
          Option 3
        </Nav.Link>
      </Nav.Item>

      <NavDropdown title="Account" id="basic-nav-dropdown" style={{ fontSize:"150%", marginLeft:"60%" }}>
        <NavDropdown.Item href="#login" style={{ color: "white" }}>Login</NavDropdown.Item>
        <NavDropdown.Item href="#register" style={{ color: "white" }}>Register</NavDropdown.Item>
      </NavDropdown>
    </Nav>
  );
}

export default PillsExample;
